import React, { useState, useEffect } from 'react';
import store from '../store/store';
import { Redirect, Link } from 'react-router-dom';
import {
	RadioGroup,
	Radio,
	FormLabel,
	FormControlLabel,
	FormControl
} from '@material-ui/core';
import '../styles/addEntry.component.styles.scss';

function AddEntry() {
	const [value, setValue] = React.useState('frontend');
	const [values, setValues] = React.useState('junior');

	const [register, setRegister] = useState(null);

	useEffect(() => {
		store.addChangeListener(onChange);

		return () => {
			return store.removeChangeListener(onChange);
		};
	}, [register]);

	function onChange() {
		setRegister(store.getRegister());
	}

	if (register) {
		store.setRegister();
		return <Redirect to="/" />;
	}
	function handleChange(event) {
		setValue(event.target.value);
	}
	function handleSubmit(event) {
		console.log(event);
	}

	return (
		<>
			<form onSubmit={handleSubmit}>
				<FormControl component="fieldset" className="flex-col addEntry-holder">
					<div className="flex-col">
						<FormLabel component="legend">Speciality</FormLabel>
						<RadioGroup
							aria-label="Speciality"
							name="speciality"
							value={value}
							onChange={handleChange}
						>
							<FormControlLabel
								value="frontend"
								control={<Radio />}
								label="Front-end"
								labelPlacement="bottom"
							/>
							<FormControlLabel
								value="backend"
								control={<Radio />}
								label="Back-end"
								labelPlacement="bottom"
							/>
							<FormControlLabel
								value="fullstack"
								control={<Radio />}
								label="Full-Stack"
								labelPlacement="bottom"
							/>
						</RadioGroup>
					</div>
					<div className="flex-col">
						<FormLabel component="legend">Category</FormLabel>
						<RadioGroup
							aria-label="Categoru"
							name="category"
							value={values}
							onChange={handleChange}
							labelPlacement="bottom"
						>
							<FormControlLabel
								value="junior"
								control={<Radio />}
								label="Junior"
								labelPlacement="bottom"
							/>
							<FormControlLabel
								value="senior"
								control={<Radio />}
								label="Senior"
								labelPlacement="bottom"
							/>
						</RadioGroup>
					</div>
				</FormControl>
				<button type="submit">here</button>
			</form>
		</>
	);
}

export default AddEntry;
